import React from 'react';

export default class ViewItems extends React.Component{
    render(){
        let items = this.props.items
        return <div>
            <table>
                    <td>Task</td>
                    <td>Due date</td>
                {items.map((item,i)=>{
                return <tbody>
                    <td>{item.task}</td>
                    <td>{item.duedate}</td>
                </tbody>
            })}
            </table>
        </div>
    }
}
